import {
	SET_REGISTRATION_ERROR,
} from '../actions/types';


export default function(state={registrationError:{}}, action){
	switch(action.type){


	case SET_REGISTRATION_ERROR:
		return {...state, registrationError:action.payload};


	default:
		return state;
	}
}
